Info:
----------
Nashville is an American musical drama television series. It was created by Academy Award winner Callie Khouri and produced by R.J. Cutler, Khouri, Dee Johnson, Steve Buchanan and Connie Britton.


Plot:
----------
The series stars Connie Britton as Rayna Jaymes, a legendary country music superstar, whose stardom begins fading, and Hayden Panettiere as rising teen star Juliette Barnes. The series premiere on ABC on October 10, 2012, had more than 8.93 million viewers. 


